{"source":{"uri":"features\/billing.feature","data":"Feature: Billing Information View\n  As a user\n  I want to fill out the billing information form\n  So that I can place an order\n\n  Background:\n    Given I am on the main catalog page\n    When I add an item to the cart and place the order\n    And I proceed with the order\n    Then I should see the billing information page\n    \n  @maximize\n  Scenario: Billing and shipping information are the same\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see the order confirmation page\n\n  @maximize\n  Scenario: Billing and shipping information are different\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/97             |\n  And I uncheck the \"Same as Bill To\" checkbox\n  And I fill in the shipping form with valid details\n    | Field          | Value               |\n    | Name           | Jane Smith          |\n    | Address        | 456 Elm St          |\n    | City           | Shelbyville         |\n    | State          | MO                  |\n    | Zip            | 63019               |\n    | Phone          | 555-987-6543        |\n  And I submit the form\n  Then I should see the order confirmation page with different bill,ship data\n\n  @maximize\n  Scenario: Credit card expiration date is invalid\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/00               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see an alert with the text \"Please enter a valid date of the form 'MM\/YY' in this field.\"\n\n  @maximize\n  Scenario: Billing form has missing required fields\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           |                     |\n      | Address        |                     |\n      | City           |                     |\n      | State          |                     |\n      | Zip            |                     |\n      | Phone          |                     |\n      | E-mail         |                     |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: \"Same as Bill To\" checkbox is not checked and shipping form is empty\n    When I fill in the billing form with valid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I uncheck the \"Same as Bill To\" checkbox\n    And I leave the shipping form empty\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: \"Same as Bill To\" checkbox is not checked and shipping form is empty\n    When I fill in the billing form with valid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I uncheck the \"Same as Bill To\" checkbox\n    And I leave the shipping form empty\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: Billing form contains invalid email format\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example        |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see an alert with the text \"Invalid email format. Please enter a valid email.\"\n\n  @maximize\n  Scenario: Successful submission with edge-case data\n    When I fill in the billing form with edge-case details\n      | Field          | Value                     |\n      | Name           | Maximilianus-Alexandros   |\n      | Address        | 789 Longname Lane Apt #7  |\n      | City           | New Springfield           |\n      | State          | WY                        |\n      | Zip            | 82001                     |\n      | Phone          | 555-123-4567              |\n      | E-mail         | unique.email@rare.coop    |\n      | Card Type      | Visa                      |\n      | Card Number    | 4111111111111111          |\n      | Expiration     | 01\/28                     |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see the order confirmation page\n\n  @maximize\n  Scenario: Invalid phone number format\n    When I fill in the billing form with invalid phone number\n      | Field          | Value               |\n      | Phone          | 555123             |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: Invalid phone number length\n    When I fill in the billing form with invalid phone number\n      | Field          | Value               |\n      | Phone          | 555-123-4567890123 |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: Missing mandatory billing details\n    When I fill in the billing form without providing mandatory fields\n      | Field          | Value               |\n      | Name           |                     |\n      | Address        |                     |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  Scenario: Billing form contains an invalid ZIP code\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62ABC               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see an alert with the text \"Please enter a valid zip code in this field.\"","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/full_flow.feature","data":"Feature: As a internet user\n         I want to enter to GMO OnLine\n         so I can place an order\n@maximaze\nScenario Outline: Place an order\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  And I see a text that says \"OnLine Catalog\"\n  And I select \"<quantities_and_items_name>\"\n  And I click the \"Place An Order\" button\n  And the selected items with their respective quantities should appear in the order summary\n  And the total price should be calculated correctly\n  And I click the \"Proceed With Order\" button\n  And I see a text that says \"Billing Information\"\n  And I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I click the \"Place The Order\" button\n  Then I should see the order confirmation page\n  And I see a button that says \"Return to Home Page\"   \n    Examples:\n    | quantities_and_items_name                                                          |\n    | 1 Back Country Shorts                                                              |\n    | 1 Hiking Boots, 1 Glacier Sun Glasses, 1 External Frame Backpack, 1 Back Country Shorts |\n    | 3 Hiking Boots, 2 External Frame Backpack, 1 Glacier Sun Glasses, 3 Padded Socks    |\n    | 1 3 Person Dome Tent, 1 External Frame Backpack, 1 Glacier Sun Glasses, 2 Hiking Boots |\n    | 1 3 Person Dome Tent, 2 Glacier Sun Glasses, 3 Hiking Boots, 2 Padded Socks         |\n    | 100 3 Person Dome Tent, 200 Hiking Boots, 1000 Glacier Sun Glasses                  |\n    \n\n@maximaze\nScenario Outline: Place an order and Return to Home Page\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  And I see a text that says \"OnLine Catalog\"\n  And I select \"<quantities_and_items_name>\"\n  And I click the \"Place An Order\" button\n  And the selected items with their respective quantities should appear in the order summary\n  And the total price should be calculated correctly\n  And I click the \"Proceed With Order\" button\n  And I see a text that says \"Billing Information\"\n  And I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I click the \"Place The Order\" button\n  And I should see the order confirmation page\n  And I click the \"Return to Home Page\" button\n  Then I see a text that says \"Welcome to Green Mountain Outpost's OnLine Catalog!\"\n  And I see a button that says \"Enter GMO OnLine\"\n  And I see a button that says \"About The GMO Site\"\n  And I see a button that says \"Browser Test Page\"\n  Examples:\n    | quantities_and_items_name                                                          |\n    | 1 Back Country Shorts                                                              |\n    | 2 Glacier Sun Glasses, 3 Back Country Shorts                                        |\n    | 1 3 Person Dome Tent, 1 Glacier Sun Glasses, 1 Hiking Boots                          |\n    | 1 External Frame Backpack, 1 Glacier Sun Glasses, 2 Hiking Boots                     |\n    | 3 3 Person Dome Tent, 2 External Frame Backpack, 1 Padded Socks                      |\n    | 1 3 Person Dome Tent, 1 Glacier Sun Glasses, 1 Back Country Shorts, 2 Hiking Boots   |\n    | 1 3 Person Dome Tent, 1 External Frame Backpack, 3 Glacier Sun Glasses               |\n    | 3 Hiking Boots, 2 Glacier Sun Glasses, 1 Padded Socks                               |\n    \n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/gmo_home_page.feature","data":"Feature: As a internet user\n         I want to enter to GMO OnLine\n         so I test that it works correctly\n@maximaze\nScenario: Visit GMOPost and see welcome text\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  Then I see a text that says \"Welcome to Green Mountain Outpost's OnLine Catalog!\"\n  And I see a button that says \"Enter GMO OnLine\"\n  And I see a button that says \"About The GMO Site\"\n  And I see a button that says \"Browser Test Page\"\n@maximaze\nScenario: Visit GMOPost catalog\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  Then I see a text that says \"OnLine Catalog\"\n  And I see a table with products to buy\n  \n@maximaze\n@GMOPage\nScenario Outline: See a product detail\n  Given I am on GMO OnLine Catalog Page\n  When I click on \"<productName>\"\n  Then I see the Section \"<sectionName>\"\n  And I see the Unit Price \"<unitPrice>\"\n  And I see the Item Number \"<itemNumber>\"\n\n  Examples:\n    | productName             | sectionName | unitPrice  | itemNumber |\n    | 3 Person Dome Tent      | tents       | $ 299.99   | 1000       |\n    | External Frame Backpack | backpack    | $ 179.95   | 1001       |\n    | Glacier Sun Glasses     | glasses     | $ 67.99    | 1002       |\n    | Padded Socks            | socks       | $ 19.99    | 1003       |\n    | Hiking Boots            | boots       | $ 109.90   | 1004       |\n    | Back Country Shorts     | shorts      | $ 24.95    | 1005       |\n    \n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/naviagate_to_billing.feature","data":"Feature: Navigate to the billing page\n  As a user\n  I want to navigate to the billing information page\n  So that I can place an order\n  \n  Scenario: Successfully navigate to the billing page\n    Given I am on the main catalog page\n    When I add an item to the cart and place the order\n    And I proceed with the order\n    Then I should see the billing information page","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/place_order.feature","data":"Feature: Place an order in the online catalog\n  As a user\n  I want to select items and quantities from the catalog\n  So that I can place an order successfully\n\n  Background:\n    Given I am on the Google homepage\n    And I visit GMO OnLine\n    And I click the \"Enter GMO OnLine\" button\n    Then I am on the online catalog homepage\n\n\n  @maximaze\n  Scenario Outline: Prevent zero quantities for each catalog item \n    When I select \"<quantities_and_items_name>\"\n    And I click the \"Place An Order\" button\n    Then I should see an alert with the message \"Please Order Something First\"\n\n    Examples:\n    | quantities_and_items_name  |\n    | 0 3 Person Dome Tent       |\n    | 0 Back Country Shorts      |\n    | 0 External Frame Backpack  |\n    | 0 Glacier Sun Glasses      |\n    | 0 Hiking Boots             |\n    | 0 Padded Socks             |\n  \n\n  @maximaze\n  Scenario Outline: Prevent negative quantities for each catalog item\n    When I select \"<quantities_and_items_name>\"\n    And I click the \"Place An Order\" button\n    Then I should see an alert with the message \"Please enter only digits in this field.\"\n\n    Examples:\n    | quantities_and_items_name  |\n    | -1 3 Person Dome Tent       |\n    | -1 Back Country Shorts      |\n    | -1 External Frame Backpack  |\n    | -1 Glacier Sun Glasses      |\n    | -1 Hiking Boots             |\n    | -1 Padded Socks             |\n\n\n  @maximaze\n  Scenario Outline: Ordering items with specific quantities\n    When I select \"<quantities_and_items_name>\"\n    And I click the \"Place An Order\" button\n    Then the selected items with their respective quantities should appear in the order summary\n    And the total price should be calculated correctly\n     \n    Examples:\n  | quantities_and_items_name              |\n  | 1 3 Person Dome Tent                   |\n  | 999 3 Person Dome Tent                 |\n  | 1 Back Country Shorts                 |\n  | 999 Back Country Shorts               |\n  | 1 External Frame Backpack             |\n  | 999 External Frame Backpack           |\n  | 1 Glacier Sun Glasses                 |\n  | 999 Glacier Sun Glasses               |\n  | 1 Hiking Boots                        |\n  | 999 Hiking Boots                      |\n  | 1 Padded Socks                        |\n  | 999 Padded Socks                      |\n  | 1 3 Person Dome Tent, 1 Glacier Sun Glasses            |\n  | 1 3 Person Dome Tent, 999 Glacier Sun Glasses          |\n  | 999 3 Person Dome Tent, 1 Glacier Sun Glasses          |\n  | 999 3 Person Dome Tent, 999 Glacier Sun Glasses        |\n  | 1 Back Country Shorts, 1 Hiking Boots                 |\n  | 999 Back Country Shorts, 999 Hiking Boots             |\n  | 1 External Frame Backpack, 999 Padded Socks           |\n  | 999 External Frame Backpack, 1 Padded Socks           |\n  | 1 3 Person Dome Tent, 1 Glacier Sun Glasses, 1 Back Country Shorts|\n  | 999 3 Person Dome Tent, 1 Glacier Sun Glasses, 999 Back Country Shorts|\n  | 1 3 Person Dome Tent, 999 Glacier Sun Glasses, 999 Back Country Shorts|\n  | 999 3 Person Dome Tent, 999 Glacier Sun Glasses, 999 Back Country Shorts|\n  | 1 External Frame Backpack, 1 Padded Socks, 1 Hiking Boots         |\n  | 999 External Frame Backpack, 999 Padded Socks, 999 Hiking Boots   |\n  | 1 3 Person Dome Tent, 1 Glacier Sun Glasses, 1 Back Country Shorts, 1 Hiking Boots|\n  | 999 3 Person Dome Tent, 999 Glacier Sun Glasses, 999 Back Country Shorts, 999 Hiking Boots|\n  | 1 External Frame Backpack, 1 Padded Socks, 1 Glacier Sun Glasses, 1 Hiking Boots|\n  | 999 External Frame Backpack, 999 Padded Socks, 999 Glacier Sun Glasses, 999 Hiking Boots|\n  | 1 3 Person Dome Tent, 1 Glacier Sun Glasses, 1 Back Country Shorts, 1 Hiking Boots, 1 Padded Socks|\n  | 999 3 Person Dome Tent, 999 Glacier Sun Glasses, 999 Back Country Shorts, 999 Hiking Boots, 999 Padded Socks|\n  | 1 External Frame Backpack, 1 Glacier
